var camera, scene, renderer;

var isUserInteracting = false, lon = 0, lat = 0, phi = 0, theta = 0;

init();
animate();

function wW() {
  return window.innerWidth;
}
function wH() {
  return window.innerHeight;
}

function init() {
  var container, loadFill, cover, mesh, loader = new THREE.TextureLoader();

  container = document.getElementById("container");
  loadFill = document.getElementById("loadFill");
  cover = document.getElementById("cover");

  camera = new THREE.PerspectiveCamera(70, wW() / wH(), 1, 2000);
  camera.target = new THREE.Vector3(0, 0, 0);

  scene = new THREE.Scene();

  var geometry = new THREE.SphereGeometry(500, 60, 40);
  geometry.scale(-1, 1, 1);

  var material = new THREE.MeshBasicMaterial({
    map: loader.load(
      "data:image/jpeg;base64,",
      function() {
        cover.style.opacity = 1;
        loadFill.style.opacity = 0;
      },
      function(e) {
        loadFill.style.width = e.loaded / e.total * 100 + "%";
      }
    )
  });

  mesh = new THREE.Mesh(geometry, material);

  scene.add(mesh);

  renderer = new THREE.WebGLRenderer();
  renderer.setPixelRatio(window.devicePixelRatio);
  renderer.setSize(wW(), wH());
  container.appendChild(renderer.domElement);

  cover.addEventListener("mousedown", onMouseDown, false);
  cover.addEventListener("mousemove", onMouseMove, false);
  cover.addEventListener("mouseup", onMouseUp, false);

  cover.addEventListener("touchstart", onMouseDown, false);
  cover.addEventListener("touchmove", onMouseMove, false);
  cover.addEventListener("touchend", onMouseUp, false);

  window.addEventListener("resize", onWindowResize, false);
}

function onWindowResize() {
  camera.aspect = wW() / wH();
  camera.updateProjectionMatrix();
  renderer.setSize(wW(), wH());
}

function onMouseDown(e) {

  e.preventDefault();

  isUserInteracting = true;

  if (e.type === "touchstart") {
    e.clientX = e.touches[0].clientX; //console.log('move: '+e.clientX)
    e.clientY = e.touches[0].clientY;
  }
  onPointerDownPointerX = e.clientX;
  onPointerDownPointerY = e.clientY;
  onPointerDownLon = lon;
  onPointerDownLat = lat;
  //console.log(cover.style.)
  if (cover.style.opacity == 1) cover.style.opacity = 0;
}

function onMouseMove(e) {
  if (isUserInteracting === true) {
    if (e.type === "touchmove") {
      e.clientX = e.touches[0].clientX;
      e.clientY = e.touches[0].clientY;
    }
    lon = (onPointerDownPointerX - e.clientX) * 0.1 + onPointerDownLon;
    lat = (e.clientY - onPointerDownPointerY) * 0.1 + onPointerDownLat;
  }
}

function onMouseUp(e) {
  isUserInteracting = false;
}

function animate() {
  requestAnimationFrame(animate);
  update();
}

function update() {
  if (isUserInteracting === false) lon -= 0.1;

  lat = Math.max(-85, Math.min(85, lat));
  phi = THREE.Math.degToRad(90 - lat);
  theta = THREE.Math.degToRad(lon);

  camera.target.x = 500 * Math.sin(phi) * Math.cos(theta);
  camera.target.y = 500 * Math.cos(phi);
  camera.target.z = 500 * Math.sin(phi) * Math.sin(theta);
  camera.lookAt(camera.target);

  renderer.render(scene, camera);
}
